import{_ as t,h as e,i as r,N as l}from"./chunks/framework.73679867.js";const h=JSON.parse('{"title":"Style","description":"","frontmatter":{},"headers":[],"relativePath":"style/index.md"}'),n={name:"style/index.md"},d=l('<h1 id="style" tabindex="-1">Style <a class="header-anchor" href="#style" aria-label="Permalink to &quot;Style&quot;">​</a></h1><h2 id="circle基础样式属性" tabindex="-1">Circle基础样式属性 <a class="header-anchor" href="#circle基础样式属性" aria-label="Permalink to &quot;Circle基础样式属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>circle-radius</strong></td><td style="text-align:left;">圆点的半径（可选，值 &gt;= 0，默认值为<code>5</code>，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>circle-color</strong></td><td style="text-align:left;">圆点的颜色（可选，默认值为<code>#000000</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-opacity</strong></td><td style="text-align:left;">圆点的不透明度（可选，取值范围为 0 ~ 1，默认值为<code>1</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-blur</strong></td><td style="text-align:left;">圆点的虚化（可选，取值范围为 0 ~ 1，默认值为<code>0</code>。当值为 1 时，表示把圆虚化到只有圆心是不透明的）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-width</strong></td><td style="text-align:left;">圆点的描边宽度（可选，值 &gt;= 0，默认值为<code>0</code>，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-color</strong></td><td style="text-align:left;">圆点的描边颜色（可选，默认值为<code>#000000</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-opacity</strong></td><td style="text-align:left;">圆点的描边不透明度（可选，取值范围为 0 ~ 1，默认值为<code>1</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-translate</strong></td><td style="text-align:left;">圆点的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为<code>[0, 0]</code>，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>circle-translate-anchor</strong></td><td style="text-align:left;">圆点的平移锚点，即相对的参考物（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-pitch-scale</strong></td><td style="text-align:left;">地图倾斜时圆点的缩放（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>。值为 viewport 时，圆点不会缩放）</td></tr><tr><td style="text-align:center;"><strong>circle-pitch-alignment</strong></td><td style="text-align:left;">地图倾斜时圆点的对齐方式（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>）</td></tr></tbody></table><h2 id="circle高亮样式支持属性" tabindex="-1">Circle高亮样式支持属性 <a class="header-anchor" href="#circle高亮样式支持属性" aria-label="Permalink to &quot;Circle高亮样式支持属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>circle-radius</strong></td><td style="text-align:left;">圆点的半径（可选，值 &gt;= 0，单位：像素，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-color</strong></td><td style="text-align:left;">圆点的颜色（可选，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-opacity</strong></td><td style="text-align:left;">圆点的不透明度（可选，取值范围为 0 ~ 1，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-blur</strong></td><td style="text-align:left;">圆点的虚化（可选，取值范围为 0 ~ 1，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-width</strong></td><td style="text-align:left;">圆点的描边宽度（可选，值 &gt;= 0，单位：像素，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-color</strong></td><td style="text-align:left;">圆点的描边颜色（可选，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-opacity</strong></td><td style="text-align:left;">圆点的描边不透明度（可选，取值范围为 0 ~ 1，默认继承基础样式）</td></tr></tbody></table><h2 id="symbol基础样式属性" tabindex="-1">Symbol基础样式属性 <a class="header-anchor" href="#symbol基础样式属性" aria-label="Permalink to &quot;Symbol基础样式属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>icon-image</strong></td><td style="text-align:left;">图标的图片（可选，这里填写在sprite雪碧图中图标名称或使用<a href="https://docs.mapbox.com/mapbox-gl-js/api/map/#map#loadimage" target="_blank" rel="noreferrer">map.loadImage</a>加载的图片）</td></tr><tr><td style="text-align:center;"><strong>icon-size</strong></td><td style="text-align:left;">图标的大小（可选，值 &gt;= 0，默认值为 1。这里实际上是图标对应的原始图片的大小的缩放比例。值为 1 表示图标大小为原始图片的大小）</td></tr><tr><td style="text-align:center;"><strong>icon-padding</strong></td><td style="text-align:left;">图标的外边距（可选，值 &gt;= 0，默认值为 2。可用于碰撞检测</td></tr><tr><td style="text-align:center;"><strong>icon-offset</strong></td><td style="text-align:left;">图标的偏移量（可选，默认值为 [0, 0]）</td></tr><tr><td style="text-align:center;"><strong>icon-anchor</strong></td><td style="text-align:left;">图标与锚点的位置关系（可选，可选值为 center、left、right、top、bottom、top-left、top-right、bottom-left、bottom-right，默认值为 center）</td></tr><tr><td style="text-align:center;"><strong>icon-rotate</strong></td><td style="text-align:left;">图标的顺时针旋转角度（可选，默认值为 0，单位：角度）</td></tr><tr><td style="text-align:center;"><strong>icon-rotation-alignment</strong></td><td style="text-align:left;">地图旋转时图标的对齐方式（可选，可选值为 map、viewport、auto，默认值为 auto）</td></tr><tr><td style="text-align:center;"><strong>icon-pitch-alignment</strong></td><td style="text-align:left;">地图倾斜时图标的对齐方式（可选，可选值为 map、viewport、auto，默认值为 auto）</td></tr><tr><td style="text-align:center;"><strong>icon-allow-overlap</strong></td><td style="text-align:left;">是否允许图标重叠（可选，默认值为 false。当值为 true 时，图标即使和其他符号触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>icon-ignore-placement</strong></td><td style="text-align:left;">是否忽略图标位置（可选，默认值为 false。当值为 true 时，其他符号即使与此图标触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>icon-opacity</strong></td><td style="text-align:left;">图标的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>icon-color</strong></td><td style="text-align:left;">图标的颜色（可选，默认值为 #000000）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-color</strong></td><td style="text-align:left;">图标的光晕颜色（可选，默认值为 rgba(0,0,0,0)）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-width</strong></td><td style="text-align:left;">图标的光晕宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-blur</strong></td><td style="text-align:left;">图标的光晕模糊宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>icon-translate</strong></td><td style="text-align:left;">图标的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为 [0, 0]，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>icon-translate-anchor</strong></td><td style="text-align:left;">图标的平移锚点，即相对的参考物（可选，可选值为 map、viewport，默认为 map）</td></tr><tr><td style="text-align:center;"><strong>text-field</strong></td><td style="text-align:left;">文本所对应的字段（可选，默认值为 &quot;&quot;）</td></tr><tr><td style="text-align:center;"><strong>text-font</strong></td><td style="text-align:left;">文本的字体集合（可选，默认值为 [&quot;Open Sans Regular&quot;,&quot;Arial Unicode MS Regular&quot;]）</td></tr><tr><td style="text-align:center;"><strong>text-size</strong></td><td style="text-align:left;">文本的大小（可选，默认值为 16，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-max-width</strong></td><td style="text-align:left;">文本的最大宽度，超过则折行（可选，默认值为 10，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-line-height</strong></td><td style="text-align:left;">文本的行高（可选，默认值为 1.2，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-letter-spacing</strong></td><td style="text-align:left;">文本的字符间距（可选，默认值为 0，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-justify</strong></td><td style="text-align:left;">文本的水平对齐方式（可选，可选值为 auto、left、center、right。默认值为 center）</td></tr><tr><td style="text-align:center;"><strong>text-anchor</strong></td><td style="text-align:left;">文本与锚点的位置关系（可选，可选值为 center、left、right、top、bottom、top-left、top-right、bottom-left、bottom-right，默认值为 center）</td></tr><tr><td style="text-align:center;"><strong>text-rotate</strong></td><td style="text-align:left;">文本的顺时针旋转角度（可选，默认值为 0，单位：角度）</td></tr><tr><td style="text-align:center;"><strong>text-padding</strong></td><td style="text-align:left;">文本的外边距（可选，值 &gt;= 0，默认值为 2。可用于碰撞检测）</td></tr><tr><td style="text-align:center;"><strong>text-transform</strong></td><td style="text-align:left;">文本大小写转换（可选，可选值为 none、uppercase、lowercase，默认值为 none）</td></tr><tr><td style="text-align:center;"><strong>text-offset</strong></td><td style="text-align:left;">图标的偏移量（可选，默认值为 [0, 0]）</td></tr><tr><td style="text-align:center;"><strong>text-allow-overlap</strong></td><td style="text-align:left;">是否允许文本重叠（可选，默认值为 false。当值为 true 时，文本即使和其他符号触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>text-ignore-placement</strong></td><td style="text-align:left;">是否忽略文本位置（可选，默认值为 false。当值为 true 时，其他符号即使与此文本触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>text-opacity</strong></td><td style="text-align:left;">文本的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>text-color</strong></td><td style="text-align:left;">文本的颜色（可选，默认值为 #000000）</td></tr><tr><td style="text-align:center;"><strong>text-halo-color</strong></td><td style="text-align:left;">文本的光晕颜色（可选，默认值为 rgba(0,0,0,0)）</td></tr><tr><td style="text-align:center;"><strong>text-halo-width</strong></td><td style="text-align:left;">文本的光晕宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-halo-blur</strong></td><td style="text-align:left;">文本的光晕模糊宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-translate</strong></td><td style="text-align:left;">文本的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为 [0, 0]，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>text-translate-anchor</strong></td><td style="text-align:left;">文本的平移锚点，即相对的参考物（可选，可选值为 map、viewport，默认为 map）</td></tr></tbody></table><h2 id="symbol高亮样式支持属性" tabindex="-1">Symbol高亮样式支持属性 <a class="header-anchor" href="#symbol高亮样式支持属性" aria-label="Permalink to &quot;Symbol高亮样式支持属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>icon-image</strong></td><td style="text-align:left;">图标的图片（可选，这里填写在sprite雪碧图中图标名称或使用<a href="https://docs.mapbox.com/mapbox-gl-js/api/map/#map#loadimage" target="_blank" rel="noreferrer">map.loadImage</a>加载的图片, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-size</strong></td><td style="text-align:left;">图标的大小（可选，值 &gt;= 0，默认值为 1。这里实际上是图标对应的原始图片的大小的缩放比例。值为 1 表示图标大小为原始图片的大小, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-opacity</strong></td><td style="text-align:left;">图标的不透明度（可选，取值范围为 0 ~ 1，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-color</strong></td><td style="text-align:left;">图标的颜色（可选，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-color</strong></td><td style="text-align:left;">图标的光晕颜色（可选，默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-width</strong></td><td style="text-align:left;">图标的光晕宽度（可选，值 &gt;= 0，单位：像素, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>icon-halo-blur</strong></td><td style="text-align:left;">图标的光晕模糊宽度（可选，值 &gt;= 0，单位：像素, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-field</strong></td><td style="text-align:left;">文本所对应的字段（可选， 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-size</strong></td><td style="text-align:left;">文本的大小（可选，单位：像素, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-opacity</strong></td><td style="text-align:left;">文本的不透明度（可选，取值范围为 0 ~ 1， 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-color</strong></td><td style="text-align:left;">文本的颜色（可选， 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-halo-color</strong></td><td style="text-align:left;">文本的光晕颜色（可选， 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-halo-width</strong></td><td style="text-align:left;">文本的光晕宽度（可选，值 &gt;= 0，单位：像素, 默认继承基础样式）</td></tr><tr><td style="text-align:center;"><strong>text-halo-blur</strong></td><td style="text-align:left;">文本的光晕模糊宽度（可选，值 &gt;= 0，单位：像素, 默认继承基础样式）</td></tr></tbody></table><h2 id="line基础样式属性" tabindex="-1">Line基础样式属性 <a class="header-anchor" href="#line基础样式属性" aria-label="Permalink to &quot;Line基础样式属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>line-color</strong></td><td style="text-align:left;">线的颜色（可选，默认值为 #000000。如果设置了 line-pattern，则 line-color 将无效）</td></tr><tr><td style="text-align:center;"><strong>line-width</strong></td><td style="text-align:left;">线的宽度（可选，值 &gt;= 0，默认值为 1，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>line-blur</strong></td><td style="text-align:left;">线的模糊度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>line-opacity</strong></td><td style="text-align:left;">线的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>line-pattern</strong></td><td style="text-align:left;">线用的图案（可选，这里填写在 sprite 雪碧图中图标名称。为了图案能无缝填充，图标的高宽需要是 2 的倍数）</td></tr><tr><td style="text-align:center;"><strong>line-gap-width</strong></td><td style="text-align:left;">线的外部间距宽度（可选，值 &gt;= 0，默认值为 0，单位：像素。用来在线的外部再绘制一部分，此值表示内间距）</td></tr><tr><td style="text-align:center;"><strong>line-offset</strong></td><td style="text-align:left;">线的偏移（可选，默认值为 0，单位：像素。对于单线，则是向右的偏移量；对于多边形，正值为内缩 inset，负值为外突 outset）</td></tr><tr><td style="text-align:center;"><strong>line-dasharray</strong></td><td style="text-align:left;">虚线的破折号部分和间隔的长度（可选，默认无虚线。如果设置了 line-pattern，则 line-dasharray 将无效）</td></tr><tr><td style="text-align:center;"><strong>line-gradient</strong></td><td style="text-align:left;">线的渐变色（可选。如果设置了 line-pattern 或 line-dasharray，则 line-gradient 将无效。只有数据源 source 的 type 为 geojson ，且 source 的 lineMetrics 为 true 时，line-gradient 才有效）</td></tr><tr><td style="text-align:center;"><strong>line-translate</strong></td><td style="text-align:left;">线的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为 [0, 0]，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>line-translate-anchor</strong></td><td style="text-align:left;">线的平移锚点，即相对的参考物（可选，可选值为 map、viewport，默认为 map）</td></tr><tr><td style="text-align:center;"><strong>line-cap</strong></td><td style="text-align:left;">线末端的显示样式（可选，可选值为 butt：方型末端（仅绘制到线的端点）；round：圆型末端（以线宽的 1/2 为半径，以线的端点为圆心，绘制圆型端点，会超出线的端点）；square：方型末端（以线宽的 1/2 长度超出线的端点）默认值为 butt</td></tr><tr><td style="text-align:center;"><strong>line-join</strong></td><td style="text-align:left;">线交叉时的显示样式（可选，可选值为 bevel：方型交点（以线宽的 1/2 长度超出线的交点）；round圆型交点（以线宽的 1/2 为半径，以线的交点为圆心，绘制圆型交点，会超出线的交点）；miter尖型交点（以两线段的外沿相交，超出交点绘制），默认值为 miter）</td></tr><tr><td style="text-align:center;"><strong>line-miter-limit</strong></td><td style="text-align:left;">最大斜接长度（可选，用来将 miter 尖型交点自动转为 bevel 方型交点，默认值为 2。只有 line-join 为 miter 时，才需要设置此属性）</td></tr><tr><td style="text-align:center;"><strong>line-round-limit</strong></td><td style="text-align:left;">最小圆角半径（可选，用来将 round 圆型交点自动转为 miter 尖型交点，默认值为 1.05。只有 line-join 为 round 时，才需要设置此属性）</td></tr></tbody></table><h2 id="line高亮样式支持属性" tabindex="-1">Line高亮样式支持属性 <a class="header-anchor" href="#line高亮样式支持属性" aria-label="Permalink to &quot;Line高亮样式支持属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>line-color</strong></td><td style="text-align:left;">线的颜色（可选，默认值为 #000000。如果设置了 line-pattern，则 line-color 将无效）</td></tr><tr><td style="text-align:center;"><strong>line-width</strong></td><td style="text-align:left;">线的宽度（可选，值 &gt;= 0，默认值为 1，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>line-blur</strong></td><td style="text-align:left;">线的模糊度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>line-opacity</strong></td><td style="text-align:left;">线的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>line-gap-width</strong></td><td style="text-align:left;">线的外部间距宽度（可选，值 &gt;= 0，默认值为 0，单位：像素。用来在线的外部再绘制一部分，此值表示内间距）</td></tr></tbody></table><h2 id="多边形基础样式属性" tabindex="-1">多边形基础样式属性 <a class="header-anchor" href="#多边形基础样式属性" aria-label="Permalink to &quot;多边形基础样式属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>stroke-color</strong></td><td style="text-align:left;">描边颜色（可选，默认值为 #000000。如果设置了 stroke-pattern，则 stroke-color 将无效）</td></tr><tr><td style="text-align:center;"><strong>stroke-opacity</strong></td><td style="text-align:left;">描边不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>stroke-width</strong></td><td style="text-align:left;">描边宽度（可选，值 &gt;= 0，默认值为 1，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>stroke-blur</strong></td><td style="text-align:left;">描边模糊度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>stroke-dasharray</strong></td><td style="text-align:left;">描边虚线的破折号部分和间隔的长度（可选，默认无虚线。如果设置了 stroke-pattern，则 stroke-dasharray 将无效）</td></tr><tr><td style="text-align:center;"><strong>stroke-pattern</strong></td><td style="text-align:left;">描边用的图案（可选，这里填写在 sprite 雪碧图中图标名称。为了图案能无缝填充，图标的高宽需要是 2 的倍数）</td></tr><tr><td style="text-align:center;"><strong>fill-color</strong></td><td style="text-align:left;">填充的颜色（可选，默认值为 #000000。如果设置了 fill-pattern，则 fill-color 将无效）</td></tr><tr><td style="text-align:center;"><strong>fill-opacity</strong></td><td style="text-align:left;">填充的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>fill-pattern</strong></td><td style="text-align:left;">填充的颜色（可选，默认值为 #000000。如果设置了 fill-pattern，则 fill-color 将无效）</td></tr><tr><td style="text-align:center;"><strong>sort-key</strong></td><td style="text-align:left;">重叠时排序（可选，默认为1，值越大，越在上层，鼠标事件只在最上层的feature触发）</td></tr></tbody></table><h2 id="多边形高亮样式支持属性" tabindex="-1">多边形高亮样式支持属性 <a class="header-anchor" href="#多边形高亮样式支持属性" aria-label="Permalink to &quot;多边形高亮样式支持属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>stroke-color</strong></td><td style="text-align:left;">描边颜色（可选，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>stroke-opacity</strong></td><td style="text-align:left;">描边不透明度（可选，取值范围为 0 ~ 1，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>stroke-width</strong></td><td style="text-align:left;">描边宽度（可选，值 &gt;= 0，单位：像素，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>stroke-blur</strong></td><td style="text-align:left;">描边模糊度（可选，值 &gt;= 0，单位：像素，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>stroke-pattern</strong></td><td style="text-align:left;">描边用的图案（可选，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>fill-color</strong></td><td style="text-align:left;">填充的颜色（可选，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>fill-opacity</strong></td><td style="text-align:left;">填充的不透明度（可选，取值范围为 0 ~ 1，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>fill-pattern</strong></td><td style="text-align:left;">填充的颜色（可选，默认继承基础属性）</td></tr><tr><td style="text-align:center;"><strong>sort-key</strong></td><td style="text-align:left;">重叠时排序（可选，默认继承基础属性值）</td></tr></tbody></table><h2 id="圆点聚合点样式属性" tabindex="-1">圆点聚合点样式属性 <a class="header-anchor" href="#圆点聚合点样式属性" aria-label="Permalink to &quot;圆点聚合点样式属性&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">属性名</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:center;"><strong>circle-radius</strong></td><td style="text-align:left;">圆点的半径（可选，值 &gt;= 0，默认值为<code>5</code>，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>circle-color</strong></td><td style="text-align:left;">圆点的颜色（可选，默认值为<code>#000000</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-opacity</strong></td><td style="text-align:left;">圆点的不透明度（可选，取值范围为 0 ~ 1，默认值为<code>1</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-blur</strong></td><td style="text-align:left;">圆点的虚化（可选，取值范围为 0 ~ 1，默认值为<code>0</code>。当值为 1 时，表示把圆虚化到只有圆心是不透明的）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-width</strong></td><td style="text-align:left;">圆点的描边宽度（可选，值 &gt;= 0，默认值为<code>0</code>，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-color</strong></td><td style="text-align:left;">圆点的描边颜色（可选，默认值为<code>#000000</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-stroke-opacity</strong></td><td style="text-align:left;">圆点的描边不透明度（可选，取值范围为 0 ~ 1，默认值为<code>1</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-translate</strong></td><td style="text-align:left;">圆点的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为<code>[0, 0]</code>，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>circle-translate-anchor</strong></td><td style="text-align:left;">圆点的平移锚点，即相对的参考物（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>）</td></tr><tr><td style="text-align:center;"><strong>circle-pitch-scale</strong></td><td style="text-align:left;">地图倾斜时圆点的缩放（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>。值为 viewport 时，圆点不会缩放）</td></tr><tr><td style="text-align:center;"><strong>circle-pitch-alignment</strong></td><td style="text-align:left;">地图倾斜时圆点的对齐方式（可选，可选值为<code>map</code>、<code>viewport</code>，默认为<code>map</code>）</td></tr><tr><td style="text-align:center;"><strong>text-field</strong></td><td style="text-align:left;">文本所对应的字段（可选，默认值为 &quot;&quot;）</td></tr><tr><td style="text-align:center;"><strong>text-font</strong></td><td style="text-align:left;">文本的字体集合（可选，默认值为 [&quot;Open Sans Regular&quot;,&quot;Arial Unicode MS Regular&quot;]）</td></tr><tr><td style="text-align:center;"><strong>text-size</strong></td><td style="text-align:left;">文本的大小（可选，默认值为 16，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-max-width</strong></td><td style="text-align:left;">文本的最大宽度，超过则折行（可选，默认值为 10，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-line-height</strong></td><td style="text-align:left;">文本的行高（可选，默认值为 1.2，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-letter-spacing</strong></td><td style="text-align:left;">文本的字符间距（可选，默认值为 0，单位：ems）</td></tr><tr><td style="text-align:center;"><strong>text-justify</strong></td><td style="text-align:left;">文本的水平对齐方式（可选，可选值为 auto、left、center、right。默认值为 center）</td></tr><tr><td style="text-align:center;"><strong>text-anchor</strong></td><td style="text-align:left;">文本与锚点的位置关系（可选，可选值为 center、left、right、top、bottom、top-left、top-right、bottom-left、bottom-right，默认值为 center）</td></tr><tr><td style="text-align:center;"><strong>text-rotate</strong></td><td style="text-align:left;">文本的顺时针旋转角度（可选，默认值为 0，单位：角度）</td></tr><tr><td style="text-align:center;"><strong>text-padding</strong></td><td style="text-align:left;">文本的外边距（可选，值 &gt;= 0，默认值为 2。可用于碰撞检测）</td></tr><tr><td style="text-align:center;"><strong>text-transform</strong></td><td style="text-align:left;">文本大小写转换（可选，可选值为 none、uppercase、lowercase，默认值为 none）</td></tr><tr><td style="text-align:center;"><strong>text-offset</strong></td><td style="text-align:left;">图标的偏移量（可选，默认值为 [0, 0]）</td></tr><tr><td style="text-align:center;"><strong>text-allow-overlap</strong></td><td style="text-align:left;">是否允许文本重叠（可选，默认值为 false。当值为 true 时，文本即使和其他符号触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>text-ignore-placement</strong></td><td style="text-align:left;">是否忽略文本位置（可选，默认值为 false。当值为 true 时，其他符号即使与此文本触碰也会显示）</td></tr><tr><td style="text-align:center;"><strong>text-opacity</strong></td><td style="text-align:left;">文本的不透明度（可选，取值范围为 0 ~ 1，默认值为 1）</td></tr><tr><td style="text-align:center;"><strong>text-color</strong></td><td style="text-align:left;">文本的颜色（可选，默认值为 #000000）</td></tr><tr><td style="text-align:center;"><strong>text-halo-color</strong></td><td style="text-align:left;">文本的光晕颜色（可选，默认值为 rgba(0,0,0,0)）</td></tr><tr><td style="text-align:center;"><strong>text-halo-width</strong></td><td style="text-align:left;">文本的光晕宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-halo-blur</strong></td><td style="text-align:left;">文本的光晕模糊宽度（可选，值 &gt;= 0，默认值为 0，单位：像素）</td></tr><tr><td style="text-align:center;"><strong>text-translate</strong></td><td style="text-align:left;">文本的平移（可选，通过平移 [x, y] 达到一定的偏移量。默认值为 [0, 0]，单位：像素。）</td></tr><tr><td style="text-align:center;"><strong>text-translate-anchor</strong></td><td style="text-align:left;">文本的平移锚点，即相对的参考物（可选，可选值为 map、viewport，默认为 map）</td></tr></tbody></table>',19),s=[d];function o(a,g,i,c,x,y){return e(),r("div",null,s)}const p=t(n,[["render",o]]);export{h as __pageData,p as default};
